(4, 'despre_noi', '<html lang=''ro''>\r\n<head>\r\n	<meta http-equiv="content-type" content="application/xhtml+xml; charset=UTF-8" />\r\n	<title>Despre noi</title>\r\n	<meta http-equiv="Pragma" content="no-cache">\r\n	<meta http-equiv="Cache-Control" content="no-cache">\r\n	<meta name="description" content="Ortoprotetica - Despre noi">\r\n	<meta name="copyright" content="&copy; 2012 Ortoprotetica" />\r\n	<LINK HREF="../css/default.css" REL="stylesheet" TYPE="text/css">\r\n	\r\n</head>\r\n<body>\r\n	<div class="titlu_pag">\r\n		Despre noi\r\n	</div>\r\n    <div>\r\n        <div style="text-indent:15px;">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla tellus quam, dignissim eget condimentum sit amet, viverra vitae turpis. Sed fermentum pellentesque ligula quis dictum. Cras volutpat scelerisque diam pellentesque imperdiet. Maecenas scelerisque, orci a sollicitudin commodo, est velit scelerisque massa, at cursus orci neque quis tortor. Nam tortor metus, fringilla sit amet cursus vel, dapibus non felis. Nulla facilisi. Nam dui est, viverra ac consectetur eu, elementum vitae arcu. Curabitur hendrerit velit ac arcu hendrerit ullamcorper. Nulla porttitor, nisi et condimentum pellentesque, nulla nunc tristique urna, convallis auctor sem massa vitae augue. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aliquam aliquam lectus vel nisi viverra ultricies. Sed porttitor dolor velit.</div>\r\n		<div style="text-indent:15px;">Donec ac sem vitae metus feugiat placerat nec vitae eros. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Suspendisse potenti. Aenean at metus ut erat sollicitudin facilisis sit amet vel mauris. Morbi rutrum justo vitae arcu commodo tempor. Nulla vitae dolor bibendum nisi suscipit congue. Nam non mi sit amet sem sollicitudin semper. Nam in augue et augue iaculis commodo. Pellentesque justo quam, adipiscing vitae facilisis a, ornare sed lectus.</div>\r\n		<div style="text-indent:15px;">Suspe